// src/pages/Login.js
import React from 'react';

const Login = () => {
  return (
    <div style={{ minHeight: 'calc(100vh - 10rem)', display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center' }}> {/* Altura mínima y centrado */}
      <h1>Iniciar Sesión</h1>
      <form style={{ maxWidth: '400px', width: '100%' }}> {/* Centra y limita el ancho del formulario */}
        <div style={{ marginBottom: '1rem' }}>
          <label htmlFor="email" style={{ display: 'block', marginBottom: '0.5rem' }}>Email:</label>
          <input type="email" id="email" name="email" style={{ width: '100%', padding: '0.5rem', borderRadius: '4px', border: '1px solid #ccc' }} />
        </div>
        <div style={{ marginBottom: '1rem' }}>
          <label htmlFor="password" style={{ display: 'block', marginBottom: '0.5rem' }}>Contraseña:</label>
          <input type="password" id="password" name="password" style={{ width: '100%', padding: '0.5rem', borderRadius: '4px', border: '1px solid #ccc' }} />
        </div>
        <button type="submit" style={{ padding: '0.5rem 1rem', backgroundColor: '#007bff', color: '#fff', border: 'none', borderRadius: '4px', cursor: 'pointer' }}>
          Iniciar Sesión
        </button>
      </form>
    </div>
  );
};

export default Login;
